import React from "react";
import {Container , Row , Col} from "reactstrap";

export default class Categories extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return <section className="categories">
            <Container>
                <Row>
                    <Col className="d-flex flex-column" sm="12">
                        <img src="/static/images/cable-1.png" className="category-image" />
                    </Col>
                    <Col className="d-flex flex-column" sm="12">
                        <img src="/static/images/cable-2.png" className="category-image" />
                    </Col>
                    <Col className="d-flex flex-column" sm="12">
                        <img src="/static/images/cable-3.png" className="category-image" />
                    </Col>
                </Row>
            </Container>
        </section>
    }
}
